27-recursive-indicators/recursive-indicator/)\n        -Un RSI de 7 periodos con nivel de sobrecopra de 70 y de sobreventa de 30.\n        '''\n#         self.lines.rsi = RSI(self.data, period=7)\n#         self.lines.ema = EMA(self.data, period=8)\n#         self.lines.ema = EMA(self.data, period=14)\n        bt.indicators.SMA(period=8)\n        bt.indicators.SMA(period=14)\n        bt.indicators.RSI(period=7, subplot=True)\n\n#         bt.indicators.RSI(self.datas[0], period=7, plotname='RSI_7')\n#         bt.indicators.ExponentialMovingAverage(self.datas[0], period=8, plotname='EMA_8')\n#         bt.indicators.ExponentialMovingAverage(self.datas[0], period=14, plotname='EMA_14')\n\n        self.lines.rf = MyRFIndicator(self.data, path_model=self.p.path_model, m=self.p.m)\n\n        self.ahead_time = 8\n        self.timeIni = None \n#         self.order = None\n\n    def notify_order(self, order):\n        ''' \u00bfPor qu\u00e9 usar notify_order?\n        Porque esto asegura que la orden que debe ser controlada por el Stop realmente se ha ejecutado. Esto puede no ser un gran problema \n        durante las pruebas de backtesting, pero lo es cuando se opera en vivo.   \n        ''' \n        if not order.status == order.Completed:\n            return  # discard any other notification\n\n        if not self.position:  # we left the market\n            print('SELL@price: {:.2f}'.format(order.executed.price))\n            return\n\n        # We have entered the market\n        print('BUY @price: {:.2f}'.format(order.executed.price))\n\n\n\n    def next(self):       \n        if not self.position:  # not in the market\n            self.timeIni = len(self.data)\n\n            if self.lines.rf[0] == 1:                 \n                size = int(self.broker.get_cash() / self.data)\n                self.buy(size=size)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n#
